import React from "react";
import {
    Nav, 
    NavLink,
    // Bars, 
    NavMenu, 
    NavBtn,
    NavBtnLink,

} from './NavbarElements';


const Home = () => {
    return(
        <div style={{
            display: 'flex',
            justifyContent: 'Right',
            alignItems: 'Right',
            height: '100vh'
        }}
        >
        </div>
    )
}

const Navbar = () => {
    return (
        <>
        <Nav>
            <Bars/>
            <NavMenu>
                <NavLink to='/Memo' activeStyle>Memo</NavLink>
                <NavLink to='/Games' activeStyle>Games</NavLink>
            </NavMenu>
        </Nav>
        </>
    );
};

export default Navbar;
